import React from "react";
// STYLES
import "../styles/Login.scss";

const Login = () => {
  return (
    <div className='Login-Component'>
      <h1 className='Login-Title'>Login</h1>
      <form>
        <input type='text' text='email'>
          email
        </input>
        <input type='text' text='password'>
          password
        </input>
        <input type='submit' value='submit'>
          submit
        </input>
      </form>
    </div>
  );
};

export { Login };
